        function fn_deleteItemSet(grid) {
            if (!fn_validateSelectedRow()) { //선택된 ITEM이 있는지 확인
                return;
            }

            if (!$.comm.confirmDelete()) {
                return;
            }

            if (!grid.isChecked()) {
                $.comm.alertMsg('invalid.not.selected'); //선택된 데이터가 없습니다.
                return;
            }

            let data = grid.getChecked().map(d => {
                return {itemCd: d["item.itemCd"], quantity: d.quantity}
            });

            var itemCd = lv_selectedRowData.itemCd;
            $.comm.del(baseUrl + "/" + itemCd + "/set", data, function (ret, status) {
                if (status == "success") {
                    $.comm.alertMsg('info.deleted');
                    fn_sublist();
                }
            });
        }
